  `department` varchar(20) DEFAULT NULL COMMENT '一级部门',
  `work_city` varchar(20) DEFAULT NULL COMMENT '工作城市',
  `year_leave_days` varchar(20) DEFAULT NULL COMMENT '年假天数',
  `leave_days` varchar(20) DEFAULT NULL COMMENT '事假天数',
